Uploads a file the normal HTTP way. You may add headers to the request in order to provide some control to your media-file.



Header
Description
Mandatory




Content-Length
Indicates the size of the entity-body.
Yes


Cache-Control
General-header field is used to specify directives that MUST be obeyed by all caching mechanisms along the request/response chain.
No


Content-Type
The media type of the entity-body.
No



Example: Upload an MP3 File
await client.Media.UploadAsync(new UploadMediaData{
        MediaName = "file.mp3",
        Path = "/path/to/file.mp3",
        ContentType = "audio/mp3"
    }
);

Media.upload(client, "file.mp3", File.open("/path/to/file.mp3"), "audio/mp3")

GET media/{mediaName}
Downloads a media file you previously uploaded.
Example: Download an MP3 File
using(var data = await client.Media.DownloadAsync("file.mp3"))
{
  var fileContent = await data.ReadAsStreamAsync();
}

content, media_type = Media.download(client, "file.mp3")

DELETE media/{mediaName}
Deletes a media file from Bandwidth API server. Make sure you don't have any application scripts still using the media before you delete. If you accidentally delete a media file, you can immediately upload a new file with the same name.
Example: Delete an MP3 File
await client.Media.DeleteAsync("file.mp3");

Media.delete(client, "file.mp3")

methods/recordings/recordings.html.body:
Recordings
Retrieve information about call recordings. The recording information retrieved by GET method contains only textual data related to call recording as described on Properties section. To properly work with recorded media content such as download and removal of media file, please access /media documentation. To learn about how to transcribe recordings, read the /recordings/{id}/transcriptions documentation.
Properties



Property
Description




id
The unique id of the recordings resource.


startTime
Date/time when the recording started. Timestamp follows the ISO8601 format (UTC).


endTime
Date/time when the recording ended. Timestamp follows the ISO8601 format (UTC).


call
The complete URL to the call resource this recording is associated with.


media
The complete URL to the media resource this recording is associated with.


state
The state of the recording, values are  recording  complete saving  *error


page
Used for pagination to indicate the page requested for querying a list of recordings. If no value is specified the default is 0.


size
Used for pagination to indicate the size of each page requested for querying a list of recordings. If no value is specified the default value is 25. (Maximum value 1000)



Recording States



State
Description




recording
Recording is currently active.


saving
Recording is complete but it is not available to download yet.


error
Recording could not be uploaded.


complete
Recording complete and available for downloading or playing.



GET recordings
List all users' call recordings. Since this operation uses HTTP GET, all the properties are specified as HTTP request parameters.
Supported Parameters



Parameter
Description
Mandatory




page
Used for pagination to indicate the page requested for querying a list. If no value is specified the default is 0.
No


size
Used for pagination to indicate the size of each page requested for querying a list. If no value is specified the default value is 25. (Maximum value 1000)
No



Example: List all recordings
curl -v -X GET https://api.catapult.inetwork.com/v1/users/{userId}/recordings \
    -u {token}:{secret} \
    -H "Content-type: application/json"

//Promise
client.Recording.list({}).then(function (recordings) {});

//Callback
client.Recording.list({}, function (err, recordings) {
    if (err) { console.log(err); }
    else {
        console.log(recordings);
    }
});

var recordings = client.Recording.List();

recordings = Recording.list(client)


